[s][/s][center][u][/u][center][table][tr][td][b]spring.[/b][/td][td][table][tr][td][url=https://dappervolk.com/profile/1293]profile[/url][url=https://dappervolk.com/forum/posts/by/1293]posts[/url][url=https://dappervolk.com/messages/new/1293]message[/url][/td][/tr][/table][/td][/tr][/table][center][table][tr][td]Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.[/td][/tr][/table][/center][/center][url=https://dappervolk.com/profile/1293][i]‚ú¶[/i][/url][/center]

CSS - - - - -

/* Code by Aly#1293 */
em { float: right; margin-top: -1.5rem; margin-bottom: -1.5rem; margin-right: 1rem; border-radius: 5rem 5rem 0 0; background: #e8b493; width: 2rem; height: 2rem; color: #fff; font-style: normal; font-size: 1rem; line-height: 2.25rem; }

/* Global Styling */
strike + div { margin: -1.25rem; padding: 1.25rem; background: #f8d1a1; }
table, tr, td { background: none; margin: 0; padding: 0; border: 0; border-radius: 0; }
div { color: #ced8e5;  font-size: 0.8vw; letter-spacing: 0.03rem;}


u + div { padding: 2.5rem; margin: 0; background-color: white; border-radius: 1rem; }


/* Left Header */
u + div table td { text-align: left; }
u + div table td strong { color: #333; font-weight: bold; font-size: 2.5rem; vertical-align: middle; }


/* Right Links */
u + div table td + td table td { text-align: right; }
u + div table td + td a { margin-left: 2.5rem; color: #b0b935; text-transform: uppercase; font-weight: bold; }
u + div table td + td a:hover { color: #333; }



/* Background */
u + div table + div { padding: 2.5rem; border-radius: 0.5rem; margin-top: 2.5rem;
background-image: url("https://images.unsplash.com/photo-1579887132228-980b3441c403?q=80&w=600"); }


/* Description */
u + div table + div table td { margin: 0; padding: 2.5rem; border-radius: 0.5rem; 
background: rgba(255, 255, 255, 0.8); color: #555; }

